I assumed VSCode used [Mocha](https://mochajs.org/) for testing, which supports `before` and `after` functions, but when I use them and I launch my tests (F5) I always get an exception like VSCode does not understand neither of these functions.

This is the relevant snippet in my test code:

``` javascript
suite("Can I Use Tests", () => {
    before((done) => { // VSCode throws an exception in this line
        // setup
        done();
    });

    test("test1", () => {
        // some test
    });
});
```

This is the error logged in the console:

```
ReferenceError: before is not defined
```

If I run my tests using Mocha, they run just fine.

Is this a bug or am I misunderstanding something?
